import React from "react";
import car from "../images/car.png";
import { ArrowRight, ChevronDown, HelpCircle } from "react-feather";
import { useForm } from "react-hook-form";

const CarFormDetails = ({ setstep }) => {
  const { register, handleSubmit, errors } = useForm();

  const onSubmit = (data) => {
    console.log(data);
  };

  return (
    <>
      <div className="car-details">
        <div className="details-intro">
          <div className="intro-img">
            <img src={car} alt="" />
          </div>
          <p>
            <b>Fill in the information</b>
          </p>
        </div>
        <form onSubmit={handleSubmit(onSubmit)}>
          <div className="container-fluid">
            <div className="row">
              <div className="col-md-12 col-12">
                <input type="text" placeholder="Enter mobile number" />
              </div>
            </div>
            <div className="row">
              <div className="col-md-12 col-12">
                <input type="text" placeholder="Enter mobile number" />
              </div>
            </div>
            <div className="row">
              <div className="col-md-12 col-12">
                <input type="text" placeholder="Enter mobile number" />
              </div>
            </div>
            <div className="row">
              <div className="col-md-12 col-12">
                <input type="text" placeholder="Enter mobile number" />
              </div>
            </div>
          </div>

          {/* <button>
            SHOW ME QUOTES&nbsp;
            <ArrowRight size={18} />
          </button> */}
        </form>
        <button className="not-my-car" onClick={() => setstep(1)}>
          Did we get it wrong&nbsp;
          <HelpCircle size={12} />
        </button>
      </div>
    </>
  );
};

export default CarFormDetails;
